import axios from "axios";
import { ref } from "vue";
import { Auth } from "@/store/auth";

export default async function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = () => {
    axios.defaults.headers.common['Authorization'] = 'Bearer ' + 't';
    return axios.get(apiUrl+"calendar/week", {
      headers: {
        'Authorization': 'Bearer '+ localStorage.getItem('token')
      }
    })
      .then(res => res.data).then(resJson => {
      return resJson;
    });
  }

  try {
    apiData.value = await apiCall();
  } catch (e) {
    throw e;
  }

  return {
    apiData
  }
}
